// Dependencies.
import React, { Component } from "react";
import "./index.css";

import IntroRibbon from "./components/IntroRibbon";
import Navbar from "./components/Navbar";
import DiveDeep from "./components/DiveDeep";

// All Components:
class App extends Component {
  render() {
    return (
      <>
        {/* App Section #1: */}
        <Navbar />
        <IntroRibbon />
        <DiveDeep />
      </>
    );
  }
}

// Do Export.
export default App;
